import React from 'react';
function Forum() {
  return (
    <div className="page">
      <h1>Fórum</h1>
      <ul>
        <li>Introdução</li>
        <li>Meus dados</li>
        <li>Usando o AgroPlanner</li>
        <li>Assinaturas e cobrança</li>
        <li>Resolução de problemas</li>
        <li>Segurança e privacidade</li>
        <li>Perguntas gerais</li>
      </ul>
    </div>
  );
}
export default Forum;
